<Czech>:
Nepodařilo se přidat ke straně {chosenTeam} ({chosenTeamCount} {chosenTeamCount=Player/Players}) kvůli nedostatku hráčů na straně {otherTeam} ({otherTeamCount} {otherTeamCount=Player/Players})

Počkej než bude na straně {otherTeam} alespoň {reqOtherteamCount} {reqOtherteamCount=Player/Players} 
(Současná velkost strany {chosenTeam} - max imbalance) nebo si vyber jednu ze zemí strany {otherTeam}.

<Ukrainian>:
Неможливо приєднатися до команди {chosenTeam} ({chosenTeamCount} {chosenTeamCount = гравець / ігрокa / гравців}) через брак гравців у команді {otherTeam} ({otherTeamCount} {otherTeamCount = гравець / ігрокa / гравців}).

Зачекайте, поки в команді {otherTeam} стане {reqOtherteamCount} {reqOtherteamCount = гравець / ігрокa / гравців}
(Поточна чисельність команди {chosenTeam} - макс дисбаланс).

<Serbian>:
Nemoguće se pridružiti timu {chosenTeam} ({chosenTeamCount} {chosenTeamCount=Player/Players}) zbog manjka igrača u timu {otherTeam} ({otherTeamCount} {otherTeamCount=Player/Players}).

Čekajte dok se {reqOtherteamCount} {reqOtherteamCount=Player/Players} u timu {otherTeam} 
(the current size of the team {chosenTeam} - max imbalance) ili izaberite jednu od država od tima {otherTeam}.

